(265, 8, 2331, '<p>In order for WGI to be successful, it is crucial that all of our employees have a common understanding of our fundamental purpose as a company. A shared vision and actively promoted values generate a feeling of unity and offer us guidance in the performance of our everyday work. Around the world, our vision and values serve as a bond, enabling us to utilize the full potential of our internationality and diversity.<br></p>'),
(266, 8, 2332, 'To help guide you through those money and wealth creation decisions to live a more fulfilled life.\r\n<br>Now we are not saying that just because we can help you increase your wealth, your life will automatically be fulfilled, that would be far too presumptuous of us. Instead we invite those who want to effect a positive improvement in their financial circumstances and plan to build wealthier future to give us the opportunity to work with you.'),
(267, 8, 2311, 'executive management'),
(268, 8, 2335, 'To always treat each other and customers with the respect and service with which we each want to be treated.\r\nTo employ qualified people, offer fair compensation, and provide an environment conducive for personal growth.\r\nTo provide a pleasant, safe and secure place to do business for both our customers and employees.\r\nTo offer superior expertise and professional service to our customers so that we may be known to be both fair and honest in all our dealings.'),
(269, 8, 2333, 'our values'),
(270, 8, 2336, 'real estate brokarage services'),
(271, 8, 2337, '<p><span style="color: rgb(0, 0, 0); font-family: "Open Sans", Helvetica, Arial, sans-serif; font-size: 16px;">We provide real estate brokerage services on residential properties in different countries we oparate. As a major real estate broker, we have a bountiful and diverse transaction experience and a broad customer network.</span><br></p>'),
(272, 8, 2338, 'consultation & financial services'),
(273, 8, 2339, 'valuation services'),
(274, 8, 2340, 'Our company also excels in offering significant Property Valuation services to our clients. Property Valuation is necessary for the owners of property, it relates to determining the economic value of the asset. A property owner must be aware of the economic value of the asset he owns to put it to future use.\r\n'),
(275, 8, 2342, 'Buying an overseas home or investment can be a daunting experience. WGI Real Estate Co. can assist in giving you valuable advice.  Our legal team and Financial advisers with years of experience in investment and property law can help you to secure your investment in one of the safest area of real estate purchase.'),
(276, 8, 2298, 'This area has not yet added content.'),
(277, 8, 2070, 'ceo messagge'),
(278, 8, 2343, '<div style="box-sizing: inherit; color: rgb(0, 0, 0); font-family: "Open Sans", Helvetica, Arial, sans-serif; font-size: 16px;">If you seek safe investment with High Returns, the answer is to own properties in developing areas including foreign markets. <br style="box-sizing: inherit;">International real estate may be the best possible way for investors to a mass fortune over the coming decade.<br style="box-sizing: inherit;">In times of great change and flux the returns can be stratospheric. With real estate, you can invest a relatively small amount of money to control a large asset.</div><div style="box-sizing: inherit; color: rgb(0, 0, 0); font-family: "Open Sans", Helvetica, Arial, sans-serif; font-size: 16px;"><br style="box-sizing: inherit;"></div><div style="box-sizing: inherit; color: rgb(0, 0, 0); font-family: "Open Sans", Helvetica, Arial, sans-serif; font-size: 16px;">Buying a real estate is no longer finding a place to call home. Investing in real estate has become increasingly popular<br style="box-sizing: inherit;">over the last 50 years and has become a common investment vehicle.</div><div style="box-sizing: inherit; color: rgb(0, 0, 0); font-family: "Open Sans", Helvetica, Arial, sans-serif; font-size: 16px;"><br style="box-sizing: inherit;"></div><div style="box-sizing: inherit; color: rgb(0, 0, 0); font-family: "Open Sans", Helvetica, Arial, sans-serif; font-size: 16px;">Real Estate  is also a great way to protect hard won capital. First of all your asset is real and has a use. You certainly cant print any more of it.<br style="box-sizing: inherit;">People will always need somewhere to live. Price bubles may come and go and come again. Mean time, your real estate always retains on instrinsic value.</div><div style="box-sizing: inherit; color: rgb(0, 0, 0); font-family: "Open Sans", Helvetica, Arial, sans-serif; font-size: 16px;"><br style="box-sizing: inherit;"></div><div style="box-sizing: inherit; color: rgb(0, 0, 0); font-family: "Open Sans", Helvetica, Arial, sans-serif; font-size: 16px;">There are real growth opportunities world wide. In fact there is a full spectrum of opportunities to profit.<br style="box-sizing: inherit;">Investing your money in international real estate is one and safest of them which will give you to keep control over your asset, you can buy,sell, rent, develop according to your requirements.<br style="box-sizing: inherit;"><br style="box-sizing: inherit;"></div><div style="box-sizing: inherit; color: rgb(0, 0, 0); font-family: "Open Sans", Helvetica, Arial, sans-serif; font-size: 16px;">You can generate a cash flow in another currency. It is a great  inflation hedge.Real Estate investment is fun, your real estate investment can double as a personal retreat, part time residence as a vacation gateaway.<br style="box-sizing: inherit;">You can enjoy it while its appreciating in value generating rental returns in safe guarding your net worth.</div><div style="box-sizing: inherit; color: rgb(0, 0, 0); font-family: "Open Sans", Helvetica, Arial, sans-serif; font-size: 16px;"><br style="box-sizing: inherit;"></div><div style="box-sizing: inherit; color: rgb(0, 0, 0); font-family: "Open Sans", Helvetica, Arial, sans-serif; font-size: 16px;">Wealth Growth Investment Co. has been established with the mission of going beyond selling a home and introducing its clients to real estate as an investment an ideal way of wealth growth for better tomorrows.</div><div style="box-sizing: inherit; color: rgb(0, 0, 0); font-family: "Open Sans", Helvetica, Arial, sans-serif; font-size: 16px;"><br style="box-sizing: inherit;"></div><div style="box-sizing: inherit; color: rgb(0, 0, 0); font-family: "Open Sans", Helvetica, Arial, sans-serif; font-size: 16px;">Fulya Köysüren<br style="box-sizing: inherit;">CEO, High Return Holding Co.<br style="box-sizing: inherit;">Founder of WGI Ltd. Co.</div>'),
