INSERT INTO `sayfa` (`id`, `ad`, `icerik`, `resim_yolu`, `modul_id`, `sira`, `seo`, `resim_yolu_thumbnail`, `goruntuleme`, `aktif`) VALUES
(22, 'hakkımızda', '<p class="MsoNormal">WGI is a full owned subsidary company of High Return Holding.\r\nFounded in Turkey and expanded to Suudi Arabia, Kuwait, Dubai,  focusing on residential real estate\r\nproperties.<o:p></o:p></p><p class="MsoNormal">WGI,  aims  a long term relationship with experienced,\r\nproven real estate developers (developer Partners) across a variety of\r\nresidential property. Our holding company has Developer Partners including in Turkey,\r\nLondon, Dubai, Switzerland, Spain and Cyprus focuses on specific property types\r\nand markets.<o:p></o:p></p><p class="MsoNormal">We value and seek our developers who have survived both up\r\nand down markets and have experience to manage assets during difficult economic\r\ntimes.<o:p></o:p></p><p class="MsoNormal">WGI, seeks to use its knowledge, experience and\r\nrelationships with developers to provide its clients with a diversified\r\nportfolio of investments in real estate development projects and acquisitions.\r\nOur goal is to provide superior and stable returns not correlated with\r\ntraditional assest classes.<o:p></o:p></p><p class="MsoNormal">In this relationship-oriented business, we choose our\r\nDeveloper Partners based on their character, experience, proven track record\r\nand performance in both up and down markets.<o:p></o:p></p><p class="MsoNormal">WGI also oparates as an  experience Real Estate Agent and Brokerage\r\nfirm providing services to local and international  investors. We are engaged in wide variety of\r\nreal estate development projects as we work in collaboration with several other\r\nentities.<o:p></o:p></p><p class="MsoNormal">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class="MsoNormal">We work with honesty and integrity in all our business\r\nactivities because we follow the highest standards of ethics and law.<o:p></o:p></p><p class="MsoNormal"><o:p></o:p></p>', 'eser1.png', 27, 1, 'hakkimizda', 'eser1_1.png', 652, 1),
(23, 'vizyonumuz', '<div><p class="MsoNormal">WGI’nin başarılarının devamı için tüm çalışanlarımızın\r\nşirketin temel amaçlarına hakim olması bir zorunluluktur.<br>Aynı vizyon ve değerlerin birlikte paylaşılmasıyla her geçen\r\ngün performansımız artmaktadır. Tüm dünyada vizyon ve değerlerimiz uluslararası\r\narenada tüm potansiyelimizi ortaya koymamızı sağlamaktadır.</p></div>', 'eser2.png', 27, 2, 'vizyonumuz', 'eser2_1.png', 207, 1),
(24, 'misyonumuz', '<p class="MsoNormal" style="text-align:justify">WGI, daha başarılı bir hayat\r\nyaşamanız için para ve varlık yaratmaya yönelik kararlarda size yol göstermeye\r\nçalışmaktadır.<br>Servetinizi çoğaltmaya yardımcı\r\nolduğu için hayatınızın doğrudan tatmin olacağını söylemek gibi bir küstahlık\r\niçine girmeden, bunun yerine, mali durumlarınızda olumlu bir gelişme sağlamak\r\nve müşterilerine  daha zengin bir gelecek\r\ninşa etme konusunda en iyi fırsatları sunmayı misyon edinmiştir.</p><p class="MsoNormal" style="text-align:justify"><o:p></o:p></p>', 'eser3.png', 27, 3, 'misyonumuz', 'eser3_1.png', 161, 1),
(28, 'danışmanlık & fi̇nansal hi̇zmetler', '<p class="MsoNormal">Başka bir ülkede gayrimenkul yatırımı tecrübe isteyen bir\r\niştir. WGI bünyesindeki, tecrübeli danışmanları ile sizlere gerekli yasal ve\r\nfianasal konularda danışmanlık hizmetleri vererek yatırmlarınızı güvence altına\r\nalmaktadır.<o:p></o:p></p>', '', 33, 2, 'danismanlik-finansal-hizmetler', '', 130, 1),
(29, 'emlak hizmetleri', 'WGI, faaliyet gösterdiğimiz farklı ülkelerde konut niteliğindeki gayrimenkul alanında aracılık hizmetleri sağlıyor.<br>WGI, önde gelen bir emlak firması olarak da verimli ve çeşitli işlem deneyimi olan geniş müşteri ağına sahiptir.\r\n', '', 33, 1, 'emlak-hizmetleri', '', 87, 1),
(30, 'ceo''nun mesajı', '<p class="MsoNormal" style="text-align:justify">Yüksek kazanç getiren ve\r\ngüvenilir bir yatırım arıyorsanız, bunun cevabı yabancı pazarlar dahil gelişen\r\nbölgelerde gayrimenkul sahibi olmaktır. <o:p></o:p></p>\r\n\r\n<p class="MsoNormal" style="text-align:justify">Uluslararası gayrimenkul,\r\nönümüzdeki on yıl içerisinde yatırımcılara servet edinmek için mümkün olan en\r\niyi yöntemlerden biridir.  Özellikle\r\nbüyük değişimin olduğu zamanlarda kazançlar çok büyük olabilir. </p>\r\n\r\n<p class="MsoNormal" style="text-align:justify">Ayrıca, gayrimenkul yatırımı\r\noldukça az bir nakit ile büyük miktarda bir serveti kontrol etme fırsatı\r\nsağlamaktadır. Gayrimenkul satın almak artık bir ev sahibi olmaktan çıkmış ve\r\nson 50 yıl içerisinde gayrimenkulde yatırım yapmak gittikçe popüler hale gelip\r\nolağan yatırım yöntemi haline gelmiştir. </p>\r\n\r\n<p class="MsoNormal" style="text-align:justify">Bunun yanı sıra, gayrimenkul, zor\r\nkazanılan sermayeyi korumanın çok iyi bir yoldur. Öncelikle varlığınız sabittir\r\nve kullanılabilir. Elbette gayrimenkulle yatırımın avantajları bunlarla da\r\nsınırlı değildir. İnsanların her zaman oturacak yere ihtiyaçları olacaktır. <o:p></o:p></p>\r\n\r\n<p class="MsoNormal" style="text-align:justify">Zaman zaman fiyatlar artar, düşer\r\nve tekrar yükselir sonuçta gayrimenkulünüz hakiki değerini muhafaza eder. </p>\r\n\r\n<p class="MsoNormal" style="text-align:justify">Dünya çapında büyük büyüme\r\nolanakları bulunmaktadır. Doğrusu, kar sağlamak için gayrimenkule yatırımın tam\r\nzamanıdır.<o:p></o:p></p>\r\n\r\n<p class="MsoNormal" style="text-align:justify">Paranızı uluslararası gayrimenkule\r\nyatırmak en emin yöntemlerin bir tanesidir. Varlığınızı kontrol edebilirsiniz\r\nve ihtiyaçlarınız doğrultusunda satın alabilir, satabilir, kiralayabilir veya\r\ngeliştirebilirsiniz. </p>\r\n\r\n<p class="MsoNormal" style="text-align:justify">Diğer bir para biriminde nakit\r\nakışı oluşturabilirsiniz. Enflasyona karşı müthiş bir tedbirdir. <o:p></o:p></p>\r\n\r\n<p class="MsoNormal" style="text-align:justify">Gayrimenkul yatırımı\r\neğlencelidir; aynı zamanda gayrimenkul yatırımınız şahsi bir dinlenme yeri ve\r\ntatil amaçlı part-time ikamet olarak kullanılabilir.<br>Gayrimenkulünüzün değeri artarken\r\nve kira getirirken zevkle yatırım yapmış olusunuz. </p>\r\n\r\n<p class="MsoNormal" style="text-align:justify">Wealth Growth Investment Şirketi,\r\nev satmaktan daha ötesine gitmiş ve daha iyi yarınlar için servet geliştirmenin\r\nideal yolu olan, yüksek getirili gayrimenkul yatırımlarını, müşterileriyle buluşturma misyonu\r\nile kurulmuştur. </p>\r\n\r\n<p class="MsoNormal">Fulya Köysüren<o:p></o:p></p>\r\n\r\n<p class="MsoNormal">High Return Holding A.Ş<br>Yönetim Kurulu Başkanı<br>WGI Real Estate Ltd. Şirketinin kurucusu   </p><p class="MsoNormal"><o:p></o:p></p>', '', 30, 1, 'ceo-nun-mesaji', '', 276, 1),
(35, 'değerlerimiz', '<p class="MsoNormal" style="text-align:justify">Birbirlerine ve müşterilerine\r\nkendisine gösterilmesini istediği saygı ile hizmet etmek.<br>Nitelikli insanları çalıştırmak,\r\nadil ücret ödemek ve şahsi gelişime yönelik ortam yaratmak. Hem çalışanları hem\r\nde müşterileri için hoş, güvenilir ve emniyetli çalışma ortamı sağlamak.\r\nÇalışmalarında adil ve dürüst olarak tanınması için müşterilerine üstün\r\nuzmanlık ve profesyonel hizmet sunmak. </p><p class="MsoNormal" style="text-align:justify"><o:p></o:p></p><p class="MsoNormal"><o:p></o:p></p><p class="MsoNormal"><o:p></o:p></p>', 'eser4.png', 27, 4, 'degerlerimiz', 'eser4_1.png', 86, 1),
(37, 'ekspertiz hizmetleri', '<p class="MsoNormal" style="text-align:justify">WGI, müşterilerine yatırım\r\nyapacakları gayrimenkuller için expertiz hizmeti sağlamakta,  gayrimekullerin gerçek ekonomik  değerinde alınıp satıldığından müşterileri\r\nadına emin olmaktadır. <o:p></o:p></p>', '', 33, 3, 'ekspertiz-hizmetleri', '', 30, 1);
