(1563, 'Yinelenen bir sayfa içeriğinin okuyucunun dikkatini dağıttığı bilinen bir gerçektir. Lorem Ipsum kullanmanın amacı, sürekli ''buraya metin gelecek, buraya metin gelecek'' yazmaya kıyasla daha dengeli bir harf dağılımı sağlayarak okunurluğu artırmasıdır. Şu anda birçok masaüstü yayıncılık paketi ve web sayfa düzenleyicisi, varsayılan mıgır metinler olarak Lorem Ipsum kullanmaktadır. Ayrıca arama motorlarında ''lorem ipsum'' anahtar sözcükleri ile arama yapıldığında henüz tasarım aşamasında olan çok sayıda site listelenir. Yıllar içinde, bazen kazara, bazen bilinçli olarak (örneğin mizah katılarak), çeşitli sürümleri geliştirilmiştir.', 1),
(1564, 'Business at real estate sector is attractive, and it gets more attractive every new day, hence the relationship between QW and real estate market, that develops and grows continuously, emerged. QW is also keen to boost its significant role in this leading sector and seeks, through its great experiences, for putting its special fingerprint at the very sector and creating win-win situation for the company and partners.\r\n\r\nIn line with our mission and role in enhancing quality & raising the value of real estate projects, QW launched a series of enormous projects that meet the highest international quality criteria and satisfy agents` requirements that top the company priorities. It also pursues its mission through long-term strategy as well as establishing & marketing real estate edifices along with agents in the different countries and endorsing transparent policy with the various sides that the company deals with. However, QW exerts all possible efforts to own the most qualified & specialized cadres in the real estate field, too.\r\n\r\nWe, at QW, do our best to grab all available opportunities and provide administrative policies that encourage creativity in order to achieve peerless investment returns and meet all agents` needs via a series of Neighborhood Projects. These projects comprised of Neighborhood Dubai 1, Neighborhood Dubai 2, Neighborhood City, Neighborhood Palace and Neighborhood Residence in Turkey besides unique future projects that will be launched soon in UAE & Germany. The new projects will be breathtaking surprise for both partners and agents in terms of innovation and great designs.\r\n\r\nOn the other hand, Board of Directors highly interests in backing & boosting the relation between QW and its agents in addition to strengthening the company presence in the real estate market. We will always feel initiative and pursue our projects that exceed expectations of both partners and the market itself. Finally, I would like to thank QW staff for their hard & sincere efforts that played a significant role in bringing success to the company projects. Many thanks go to our agents and partners for their valuable trust and we promise them to launch further super projects and achieve unparalleled investment returns as well.\r\n\r\n\r\nAhmad Dahab\r\nCEO', 1);
