(1966, '<p class="MsoNormal">HR HOLDING GROUP OF COMPANIES<o:p></o:p></p>\r\n\r\n<p class="MsoNormal">HR, is a holding company operates in Real Estate,\r\nConstruction, Legal Consultancy, Financial & Tax Managament.<o:p></o:p></p>\r\n\r\n<p class="MsoNormal">HR, provide  high\r\nquality services both locally and internationally to investers worldwide and\r\ncreate economic growth in the areas we operate.<o:p></o:p></p>\r\n\r\n<p class="MsoNormal"><o:p> </o:p></p>\r\n\r\n<p class="MsoNormal">HR REAL ESTATE                                KOYSUREN LAW\r\nOFFICE                          FALCON\r\nCONSTRUCTION<o:p></o:p></p>\r\n\r\n<p class="MsoNormal"><o:p> </o:p></p>\r\n\r\n<p class="MsoNormal">……..CONTRUCTION                          ALTIN TIMSAH\r\nCONSTRUCTION <o:p></o:p></p>', 1),
(1967, '<p class="MsoNormal">HR HOLDING GROUP OF COMPANIES<o:p></o:p></p>\r\n\r\n<p class="MsoNormal">HR, is a holding company operates in Real Estate,\r\nConstruction, Legal Consultancy, Financial & Tax Managament.<o:p></o:p></p>\r\n\r\n<p class="MsoNormal">HR, provide  high\r\nquality services both locally and internationally to investers worldwide and\r\ncreate economic growth in the areas we operate.<o:p></o:p></p>\r\n\r\n<p class="MsoNormal"><o:p> </o:p></p>\r\n\r\n<p class="MsoNormal">HR REAL ESTATE                       KOYSUREN LAW\r\nOFFICE                          FALCON\r\nCONSTRUCTION                     <span style="line-height: 1.45;">ALTIN TIMSAH\r\nCONSTRUCTION </span></p><p class="MsoNormal"><o:p></o:p></p>', 1),
