INSERT INTO `words` (`id`, `word`, `site`) VALUES
(1974, '<h3 align="center" style="margin-top:0cm;text-align:center;line-height:15.75pt"><span style="font-family: Arial, sans-serif; color: black;">Our mission<o:p></o:p></span></h3><h3 align="center" style="margin-top:0cm;text-align:center;line-height:15.75pt"><span style="font-family: Arial, sans-serif; color: black;">To help guide you through those money and wealth\r\ncreation decisions to live a more fulfilled life.</span><span style="font-size: 13.5pt; font-family: Arial, sans-serif; color: black;"><o:p></o:p></span></h3><h3 align="center" style="margin-top:0cm;text-align:center;line-height:15.75pt">\r\n\r\n\r\n\r\n<p align="center" style="line-height: 15.75pt;"><span style="font-size:11.5pt;font-family:"Arial",sans-serif;color:black">Now we are\r\nnot saying that just because we can help you increase your wealth, your life\r\nwill automatically be fulfilled, that would be far too presumptuous of us.\r\nInstead we invite those who want to effect a positive improvement in their\r\nfinancial circumstances and plan to build wealthier future to give us the\r\nopportunity to work with you.<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal" align="center"><o:p> </o:p></p></h3>', 1),
(1975, '<p class="MsoNormal">WGI, focusing solely on residential real estate investments.\r\nFounded in Turkey and expanded to Suudi Arabia, Kuwait, Dubai.<o:p></o:p></p><p class="MsoNormal">WGI,  focuses on along\r\nterm relationships with experienced, proven real estate developers (developer\r\nPartners) across a variety of residential property. Our holding company has Developer\r\nPartners including in London, Switzerland, Spain and Cyprus focuses on specific\r\nproperty types and markets. <o:p></o:p></p><p class="MsoNormal">We value and seek our developers who have survived both up\r\nand down markets and have experience to manage assets during difficult economic\r\ntimes. <o:p></o:p></p><p class="MsoNormal">WGI, seeks to use its knowledge, experience and\r\nrelationships with developers to provide its clients with a diversified\r\nportfolio of investments in real estate development projects and acquisitions.\r\nOur goal is to provide superior and stable returns not correlated with\r\ntraditional assest classes.<o:p></o:p></p><p class="MsoNormal">In this relationship-oriented business, we choose our\r\nDeveloper Partners based on their character, experience, proven track record\r\nand performance in both up and down markets.<o:p></o:p></p><p class="MsoNormal">We avoid ‘one-time’ partnership that preclude long-term,\r\nreproduciable results. <o:p></o:p></p><p class="MsoNormal">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class="MsoNormal" style="margin: 18pt 0cm 9pt; text-align: justify; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 9pt; font-family: Arial, sans-serif; color: rgb(85, 85, 85); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">WGI,is an experience Real Estate Agent and\r\nBrokerage firm providing services to local and International  Investors. We are engaged in wide variety of\r\nreal estate development projects as we work in collaboration with several other\r\nentities. The projects under us are high in quality. We strive hard to satisfy\r\nour clients by offering them with finest amenities and advanced planning in\r\nterm of residential properties. We work with honesty and integrity in all our\r\nbusiness activities because we follow the highest standards of ethics and law. </span><span style="font-size:14.5pt;font-family:"Arial",sans-serif;mso-fareast-font-family:\r\n"Times New Roman";color:#927054;mso-fareast-language:TR"><o:p></o:p></span></p><p class="MsoNormal"><o:p></o:p></p>', 1),
(1976, '<h3 align="center" style="margin-top: 0cm; text-align: center;"><p align="center"><span style="color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 15.3333px; line-height: 21px;">Our mission</span></p><p align="center"><span style="color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 15.3333px; line-height: 21px;">To help guide you through those money and wealth creation decisions to live a more fulfilled life.</span></p><p align="center"><span style="color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 15.3333px; line-height: 21px;">Now we are not saying that just because we can help you increase your wealth, your life will automatically be fulfilled, that would be far too presumptuous of us. Instead we invite those who want to effect a positive improvement in their financial circumstances and plan to build wealthier future to give us the opportunity to work with you.</span></p><p align="center" style="line-height: 15.75pt;"><br></p></h3>', 1),
(1977, '<h3 align="center" style="margin-top: 0cm; text-align: center;"><hr><p align="center"><span style="color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 15.3333px; line-height: 21px;">Our mission</span></p><p align="center"><span style="color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 15.3333px; line-height: 21px;"><br></span></p><p align="center"><span style="color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 15.3333px; line-height: 21px;">To help guide you through those money and wealth creation decisions to live a more fulfilled life.</span></p><p align="center"><span style="color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 15.3333px; line-height: 21px;">Now we are not saying that just because we can help you increase your wealth, your life will automatically be fulfilled, that would be far too presumptuous of us. Instead we invite those who want to effect a positive improvement in their financial circumstances and plan to build wealthier future to give us the opportunity to work with you.</span></p><p align="center"><br></p></h3>', 1),
(1978, '<h3 align="center" style="margin-top: 0cm; text-align: center;"><span style="color: rgb(0, 0, 0); font-family: Calibri, sans-serif; line-height: 21px;">Our mission</span></h3><h3 align="center" style="margin-top: 0cm; text-align: center;"><span style="color: rgb(0, 0, 0); font-family: Calibri, sans-serif; line-height: 21px;">To help guide you through those money and wealth creation decisions to live a more fulfilled life.</span></h3><h3 align="center" style="margin-top: 0cm; text-align: center;"><span style="color: rgb(0, 0, 0); font-family: Calibri, sans-serif; line-height: 21px;">Now we are not saying that just because we can help you increase your wealth, your life will automatically be fulfilled, that would be far too presumptuous of us. Instead we invite those who want to effect a positive improvement in their financial circumstances and plan to build wealthier future to give us the opportunity to work with you.</span></h3><h3 align="center" style="margin-top:0cm;text-align:center;line-height:15.75pt"><br></h3>', 1),
