(2137, ' WGI, focusing solely on residential real estate investments. Founded in Turkey and expanded to Suudi Arabia, Kuwait, Dubai.\r\nWGI,  focuses on along term relationships with experienced, proven real estate developers (developer Partners) across a variety of residential property. Our holding company has Developer Partners including in London, Switzerland, Spain and Cyprus focuses on specific property types and markets. \r\nWe value and seek our developers who have survived both up and down markets and have experience to manage assets during difficult economic times. \r\nWGI, seeks to use its knowledge, experience and relationships with developers to provide its clients with a diversified portfolio of investments in real estate development projects and acquisitions. Our goal is to provide superior and stable returns not correlated with traditional assest classes.\r\nIn this relationship-oriented business, we choose our Developer Partners based on their character, experience, proven track record and performance in both up and down markets.\r\nWe avoid ‘one-time’ partnership that preclude long-term, reproduciable results. \r\nWGI,is an experience Real Estate Agent and Brokerage firm providing services to local and International  Investors. We are engaged in wide variety of real estate development projects as we work in collaboration with several other entities. The projects under us are high in quality. We strive hard to satisfy our clients by offering them with finest amenities and advanced planning in term of residential properties. We work with honesty and integrity in all our business activities because we follow the highest standards of ethics and law. ', 1),
(2138, 'Our mission\r\nTo help guide you through those money and wealth creation decisions to live a more fulfilled life.\r\nNow we are not saying that just because we can help you increase your wealth, your life will automatically be fulfilled, that would be far too presumptuous of us. Instead we invite those who want to effect a positive improvement in their financial circumstances and plan to build wealthier future to give us the opportunity to work with you.\r\n\r\n', 1),
(2139, 'Mission\r\nTo acknowledge God in all our ways and reverently look to Him for guidance.\r\nTo always treat each other and customers with the respect and service with which we each want to be treated.\r\nTo employ qualified people, offer fair compensation, and provide an environment conducive for personal growth.\r\nTo provide a pleasant, safe and secure place to do business for both our customers and employees.\r\nTo offer superior expertise and professional service to our customers so that we may be known to be both fair and honest in all our dealings.\r\n\r\n', 1),
