(2209, 'WGI, focusing solely on residential real estate investments. Founded in Turkey and expanded to Suudi Arabia, Kuwait, Dubai.\r\n\r\nWGI,  focuses on along term relationships with experienced, proven real estate developers (developer Partners) across a variety of residential property. Our holding company has Developer Partners including in London, Switzerland, Spain and Cyprus focuses on specific property types and markets.\r\n\r\nWe value and seek our developers who have survived both up and down markets and have experience to manage assets during difficult economic times.\r\n\r\nWGI, seeks to use its knowledge, experience and relationships with developers to provide its clients with a diversified portfolio of investments in real estate development projects and acquisitions. Our goal is to provide superior and stable returns not correlated with traditional assest classes.\r\n\r\nIn this relationship-oriented business, we choose our Developer Partners based on their character, experience, proven track record and performance in both up and down markets.\r\n\r\nWe avoid ‘one-time’ partnership that preclude long-term, reproduciable results.\r\n\r\nWGI,is an experience Real Estate Agent and Brokerage firm providing services to local and International  Investors. We are engaged in wide variety of real estate development projects as we work in collaboration with several other entities. The projects under us are high in quality. We strive hard to satisfy our clients by offering them with finest amenities and advanced planning in term of residential properties.\r\n\r\nWe work with honesty and integrity in all our business activities because we follow the highest standards of ethics and law. ', 1),
