(2222, 'Our company also excels in offering significant Property Valuation services to our clients. Property Valuation is necessary for the owners of property, it relates to determining the economic value of the asset. A property owner must be aware of the economic value of the asset he owns to put it to future use. ', 1),
(2223, '<div>If you seek safe investment with High Returns, the answer is to own properties in developing areas including foreign markets. <br>International real estate may be the best possible way for investors to a mass fortune over the coming decade.<br>In times of great change and flux the returns can be stratospheric. With real estate, you can invest a relatively small amount of <br>money to control a large asset.</div><div><br></div><div>Buying a real estate is no longer finding a place to call home. Investing in real estate has become increasingly popular<br>over the last 50 years and has become a common investment vehicle.</div><div><br></div><div>Real Estate  is also a great way to protect hard won capital. First of all your asset is real and has a use. You certainly cant print any more of it.<br>People will always need somewhere to live. Price bubles may come and go and come again. Mean time, your real estate always retains on instrinsic value.</div><div><br></div><div>There are real growth opportunities world wide. In fact there is a full spectrum of opportunities to profit.<br>Investing your money in international real estate is one and safest of them which will give you to keep control over your asset, you can buy,<br>sell, rent, develop according to your requirements.<br>You can generate a cash flow in another currency. It is a great  inflation hedge.<br>Real Estate investment is fun, your real estate investment can double as a personal retreat, part time residence as a vacation gateaway.<br>You can enjoy it while its appreciating in value generating rental returns in safe guarding your net worth. </div><div><br></div><div>Wealth Growth Investment Co. has been established with the mission of going beyond selling a home and introducing its clients <br>to real estate as an investment an ideal way of wealth growth for better tomorrows.</div><div><br></div><div>Fulya Köysüren<br>CEO, High Return Holding Co.<br>Founder of WGI Ltd. Co.<br></div>', 1),
(2224, 'WGI, operates an ever-expanding network of international offices accross the globe offering sales and consultancy services to buyers, sellers and property developers. We constantly examine the markets within which we operate, integrated, strategic and cost effective sales and marketing services.\nWGI, network of estate agents in with years of experience, our agents are friendly and professional  and keen to offer their dedicated expertise on a full range of services including, valuations, residentail developments and all related legal, and financial services.\nWGI, is welcoming and inviting similar goal oriented partners, agents to join us.\n', 1),
